#header {
  margin-top: 4.5rem;
  text-align: center;
  .container {
    img {
      width: 90%;
      transform: scale(1.2);
      transition: 0.5s;
      @include media("<=phone") {
        width: 100%;
        transform: scale(1.2);
      }

      @include media(">=tablet") {
        width: 80%;
      }

      @include media(">=desktop") {
        width: 70%;
        transform: none;
      }
    }
    #form {
      position: relative;
      top: 50px;
      align-items: center;
      #inputPokemon {
        width: 85%;
        height: 40px;

        border-radius: 5px;
        border: 1px solid var(--pokemonBlue);

        padding: 10px;

        outline: none;

        font-family: $poppins;
        color: grey;

        @include media(">=tablet") {
          width: 70%;
          margin-left: 2.5rem;

          height: 43px;
        }

        @include media(">=desktop") {
          width: 55%;
        }
        &::placeholder {
          font-size: 14px;
        }
        &:focus {
          border: 2px solid var(--pokemonBlue);
          box-shadow: 0px 0px 2px 1px var(--pokemonBlue);
        }
      }
    }

    #form:focus + .btnSearch {
      border: 1px solid var(--pokemonBlue);
    }

    .btnSearch {
      position: absolute;
      height: 35px;
      width: 40px;
      font-size: 16px;
      right: 8.5%;
      top: 3%;

      border-radius: 4px;
      background: var(--pokemonYellow);
      box-shadow: inset 1px 1px grey;
      border: 1px solid white;

      border-left: none;
      border-right: none;

      color: var(--pokemonBlue);

      cursor: pointer;

      padding: 6px;

      @include media(">=tablet") {
        height: 39px;
        right: 12.3%;
      }
      @include media(">=desktop") {
        right: 21%;
      }

      &:hover {
        background-color: var(--btnhover);
        color: var(--btnhoverColor);
      }

      img {
        width: 19px;

        @include media(">=tablet") {
          width: 25px;
        }
      }
    }
    #span {
      font-family: $poppins;
      font-size: 12px;
      margin-top: 4rem;

      color: rgb(134, 89, 5);
    }
  }
}

