// Pokemon Card
.grid {
  display: grid;

  grid-template-columns: repeat(4, 1fr);
  grid-gap: 2em;

  font-family: $poppins;

  border-radius: 5px;

  margin: 6rem auto 0rem auto;

  width: 50%;

  @include media("<=phone") {
    width: 60%;
  }

  @include media(">=tablet") {
    width: 30%;
  }

  @include media(">=desktop") {
    width: 80%;
  }

  .pokemonDiv {
    display: grid;
    place-items: center;

    background-color: #defde0;
    border-radius: 10px;

    padding: 20px;

    width: 100%;
    height: 280px;

    @include media(">=tablet") {
      height: 300px;
    }

    .img__Container {
      background-color: white;
      border-radius: 50%;

      height: 130px;
      width: 130px;

      text-align: center;

      img {
        margin-top: 25px;

        max-width: 85%;

        @include media(">=tablet") {
          max-width: 90%;
        }
      }
    }
  }
}

